document.addEventListener("DOMContentLoaded",()=>{document.querySelector(".container__mobile i").addEventListener("click",()=>{document.querySelector(".container__menu").classList.add("show")}),document.querySelector(".logoHeader i").addEventListener("click",()=>{document.querySelector(".container__menu").classList.remove("show")}),document.querySelectorAll(".container__menu__items .item").forEach(t=>{t.addEventListener("click",n=>{var e;(e=n.target.querySelector(".subitems"))==null||e.classList.add("show")})})});
